import React from 'react';

function Auth() {
  return (
    <div className="flex justify-center flex-col h-[80vh]">
      <div className="w-1/3 mx-auto p-16 rounded-lg">
        <div>
          Bon retour parmi nous ! Nous sommes très excités de vous voir à
          nouveau
        </div>
        <form>
          EMAIL OU NUMÉRO DE TÉLÉPHONE MOT DE PASSE Mot de passe oublié ? Login
        </form>
        <div>Pas encore de compte ? S&apos;enregistrer</div>
      </div>
    </div>
  );
}

export default Auth;
